void ReadCountryInfo() {

	BYTE* p = EHexToByte(""
		""
		"");
	// 读取 CountryCount
	Read8(p); // CountryCount

	// 读取 CountryInfo
	uint16_t len = Read16(p); // len
	g_CountryInfo.CountryID = Read8(p); // CountryID
	g_CountryInfo.ChannelNum = Read8(p); // ChannelNum

	// 动态分配频道数组
	g_CountryInfo.Channel.resize(g_CountryInfo.ChannelNum);

	for (size_t i = 0; i < g_CountryInfo.ChannelNum; i++) {
		// 读取 ChannelInfo
		BYTE* pChannelInfo = p;
		int len = Read16(pChannelInfo); // len
		g_CountryInfo.Channel[i].ChannelID = Read8(pChannelInfo); // ChannelID
		g_CountryInfo.Channel[i].IDCNum = Read8(pChannelInfo); // IDCNum

		// 动态分配 IDC 数组
		g_CountryInfo.Channel[i].IDC.resize(g_CountryInfo.Channel[i].IDCNum);

		for (size_t j = 0; j < g_CountryInfo.Channel[i].IDCNum; j++) {
			// 读取 IDCServerInfo
			BYTE* pIDCServerInfo = pChannelInfo;
			int len = Read16(pIDCServerInfo); // len
			g_CountryInfo.Channel[i].IDC[j].LocationID = Read16(pIDCServerInfo); // LocationID
			g_CountryInfo.Channel[i].IDC[j].GameServerNum = Read8(pIDCServerInfo); // GameServerNum

			// 动态分配游戏服务器数组
			g_CountryInfo.Channel[i].IDC[j].GameServer.resize(g_CountryInfo.Channel[i].IDC[j].GameServerNum);
			for (size_t k = 0; k < g_CountryInfo.Channel[i].IDC[j].GameServerNum; k++) {
				// 读取 GameServerInfo
				BYTE* pGameServerInfo = pIDCServerInfo;
				int len = Read16(pGameServerInfo); // len

				g_CountryInfo.Channel[i].IDC[j].GameServer[k].ServerID = Read32(pGameServerInfo); // ServerID
				g_CountryInfo.Channel[i].IDC[j].GameServer[k].ServerIP = Read32(pGameServerInfo); // ServerIP
				g_CountryInfo.Channel[i].IDC[j].GameServer[k].TcpPort = Read16(pGameServerInfo); // TcpPort
				g_CountryInfo.Channel[i].IDC[j].GameServer[k].UdpPort = Read16(pGameServerInfo); // UdpPort
				g_CountryInfo.Channel[i].IDC[j].GameServer[k].MaxPlayerNum = Read16(pGameServerInfo); // MaxPlayerNum
				g_CountryInfo.Channel[i].IDC[j].GameServer[k].CurrentPlayerNum = Read16(pGameServerInfo); // CurrentPlayerNum
				g_CountryInfo.Channel[i].IDC[j].GameServer[k].RandomKey = Read32(pGameServerInfo); // RandomKey
				g_CountryInfo.Channel[i].IDC[j].GameServer[k].IsDisabledLogin = Read8(pGameServerInfo); // IsDisabledLogin
				char cMultiIPInfo = Read8(pGameServerInfo); // HasMultiIPInfo
				//pGameServer[k].MultiIPInfo = new MultiIPInfo[cMultiIPInfo];
				// 如果 MultiIPInfo 存在，读取对应信息
				for (size_t l = 0; l < cMultiIPInfo; l++) { // 这里的 0 应该根据具体需求调整
					BYTE* pMultiIPInfo = pGameServerInfo; // MultiIPInfo 的指针
					int len1 = Read16(pMultiIPInfo); // len
					int IPCount = Read8(pMultiIPInfo); // IPCount
					for (size_t i = 0; i < IPCount; i++)
					{
						Read32(pMultiIPInfo);
					}
					int len = Read8(pMultiIPInfo);
					// 读取 DomainLen 字符串
					ReadString(pMultiIPInfo, len);
					pGameServerInfo += len1;
				}
				pIDCServerInfo += len;
			}
			pChannelInfo += len;
		}
		p += len;
	}

	OutputCountryInfo();
}

