void ResponseGetChatRoomList(std::shared_ptr<ClientNode> Client, USHORT GetRoomType);
void RequestGetChatRoomList(std::shared_ptr<ClientNode> Client, BYTE* Body, size_t BodyLen)
{
	UINT Uin = Read32(Body);
	UINT Time = Read32(Body);

	USHORT StartRoomIdx = Read16(Body);
	USHORT GetRoomNum = Read16(Body);
	USHORT GetRoomType = Read16(Body);

	//printf("GetRoomType:%d\n", GetRoomType);
	//fflush(stdout);
	//GetRoomType和RoomType相同才能进入房间
	ResponseGetChatRoomList(Client, GetRoomType);
}

void ResponseGetChatRoomList(std::shared_ptr<ClientNode> Client, USHORT GetRoomType)
{
	std::vector<BYTE> buf(819200); BYTE* p = buf.data();
	//BYTE* p = buf;
	size_t len;


	Write16(p, 0); //ResultID
	Write8(p, 0); //ReasonLen
	Write16(p, 6); //CurTotalRoomNum
	Write16(p, 0); //StartRoomIdx

	Write16(p, ChatRoomNum); //ChatRoomNum
	for (size_t i = 0; i < ChatRoomNum; i++)
	{ //ChatRoomInfo
		BYTE* pChatRoomInfo = p;
		Write16(pChatRoomInfo, 0); //len

		Write32(pChatRoomInfo, g_RelaxServerInfo.ServerInfo.ServerID); //ServerID
		Write32(pChatRoomInfo, ChatRooms[i].ID); //ChatRoomID

		len = strlen(ChatRooms[i].Name);
		Write8(pChatRoomInfo, (BYTE)len); //RoomNameLen
		memcpy(pChatRoomInfo, ChatRooms[i].Name, len);
		pChatRoomInfo += len;

		Write16(pChatRoomInfo, ChatRooms[i].CurrPlayerNum); //CurrPlayerNum
		Write16(pChatRoomInfo, ChatRooms[i].MaxPlayerNum); //MaxPlayerNum

		Write32(pChatRoomInfo, 0); //RoomType
		Write16(pChatRoomInfo, ChatRooms[i].SceneID); //SceneID
		Write16(pChatRoomInfo, 0); //CurrMaleNum

		len = pChatRoomInfo - p;
		Set16(p, (WORD)len);
		p += len;
	}
	Write16(p, GetRoomType); //GetRoomType


	len = p - buf.data();
	SendToClient(Client, 91, buf.data(), len, 0, FE_DIRSVRD, 0, Response);
}

void NotifyLuckyMatchReady(std::shared_ptr<ClientNode> Client)
{
	BYTE buf[8192]; BYTE* p = buf; size_t len;

	Write16(p, g_MatchServerInfo.ServerInfo.ServerID); //ServerID
	Write32(p, g_MatchServerInfo.ServerInfo.ServerIP); //ExtenalIP
	Write8(p, 1); //ExtTcpPortNum
	Write16(p, g_MatchServerInfo.ServerInfo.TcpPort); //ExternalTcpPort[]
	Write8(p, 1); //ExtUdpPortNum
	Write16(p, g_MatchServerInfo.ServerInfo.TcpPort); //ExternalUdpPort[]
	Write32(p, 0); //RoomID
	Write8(p, 1); //HasMultiIPInfo
	for (size_t i = 0; i < 1; i++)
	{ //MultiIPInfo
		BYTE* pMultiIPInfo = p;
		Write16(pMultiIPInfo, 0); //len

		Write8(pMultiIPInfo, 1); //IPCount
		Write32(pMultiIPInfo, g_MatchServerInfo.ServerInfo.ServerID); //ServerIP[]
		Write8(pMultiIPInfo, 0); //DomainLen

		len = pMultiIPInfo - p;
		Set16(p, (WORD)len);
		p += len;
	}

	len = p - buf;
	SendToClient(Client, 815, buf, len, Client->ConnID, FE_PLAYER, Client->ConnID, Notify);
}
